INSERT INTO `actualites` (`id`, `titre_actualite`, `image_actualite`, `description`, `rfk`, `created_at`, `updated_at`) VALUES
(5, 'Un hommage inédit à une grande dame de l’histoire ivoirienne', 'https://tabalaeditions.com/media/imageactuality/imageactuality1758717715.jpg', '<p>Marie-Thérèse Houphouët-Boigny : naissance d’une icône, une biographie inédite signée Brice Brou, consacrée à celle qui a été la toute première « Première dame » de Côte d’Ivoire, vient de paraître chez Tabala Éditions.</p><p>Cette biographie minutieusement documentée, agrémentée de photos, dresse le portrait saisissant d’une femme hors du commun, témoin privilégié et actrice majeure de l’histoire contemporaine ivoirienne et africaine.</p><p>Figure de grâce, de modernité et d’élégance, Marie-Thérèse Houphouët-Boigny a marqué de son empreinte les jeunes années de l’indépendance de la Côte d’Ivoire, incarnant avec éclat le rôle alors naissant de Première dame. Elle a aussi été, aux yeux du monde, l’un des visages les plus rayonnants d’un continent en pleine émancipation.</p><p>Avec une plume sensible et rigoureuse, Brice Brou retrace le destin exceptionnel de celle que l’on surnommait parfois « la Jackie Africaine », évoquant à la fois l’intimité d’un couple présidentiel mythique et la profondeur humaine d’une femme dont le parcours est encore aujourd’hui source d’inspiration.</p><p>Né d’un projet mémoriel amorcé sur les réseaux sociaux et nourri par de nombreuses confidences, ce livre est le fruit de plus de quinze années de recherches et de passion. Il constitue un document de référence, une oeuvre de transmission et un acte de reconnaissance envers celle que des générations entières continuent d’admirer avec ferveur.</p><p>En publiant Marie-Thérèse Houphouët-Boigny : naissance d’une icône, Tabala Éditions réaffirme son engagement à valoriser les figures majeures de l’histoire africaine et à offrir aux lecteurs de tout âge des ouvrages qui éclairent, honorent et élèvent.</p><p>Le livre est disponible en édition limitée, numéroté de 1 à 200 dans l’ensemble du réseau de distribution de Tabala Éditions à travers le monde.</p><p><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"IMG-20250924-WA0006.jpg\"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"IMG-20250924-WA0007.jpg\"><img src=\"data:image/jpeg;base64,\" style=\"width: 50%;\" data-filename=\"IMG-20250924-WA0008.jpg\"><br></p>', '76himvb0pk946n54ttfrtviyjm31qflkgar92jghexayzdx1sfi34nu8l2puu8bxlc0gwo3re52zeajsd6b8qcozwsy50qk7mwon', '2025-09-24 10:41:55', '2025-09-24 10:41:55');

