(9, 'Collectif', 'Année d\'édition : 2022\r\nFormat d\'impression : 19,5 x 26,5 cm\r\nNombres de pages : 122 pages\r\nISBN : 978-2-37840-022-4', '2500', '1900', '16', 'Manuel de mathématique CE2', 'Le manuel de mathématique conçu dans le respect des instructions officielles,\r\nadapté à l’Approche Par les Compétences (APC) favorise la réflexion personnelle\r\net l’autonomie.\r\nIl est non seulement vivant et contextualisé mais également pratique et utilitaire.\r\nC’est un outil qui permet à l’élève d’apprendre la mathématique, à travers des\r\nactivités variées et ludiques, en ayant recours à la découverte des nombres, leur\r\nconstruction, la réalisation des opérations, la découverte des figures planes et des\r\nmesures de longueurs.', 'Manuel rédigé par l’équipe du Centre National de Formation et de Production de Matériels Didactiques', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685123061.png', NULL, 0, '2022', 'Tabala Editions', 'ww78q2r8ly33n6x52fpyahnes49cdrkkft3mzq4g9hcmu0obvqz1txn4xz1e2a5lwagi6tbd1jhlbrisfdyp07jocuoe6ui5g9ps', '2023-05-26 15:44:22', '2023-05-26 15:44:22'),
