(11, 'Camille Kouamé', 'Année d\'édition : 2019\r\nFormat d\'impression : 15 x 21cm\r\nNombres de pages : 64 pages\r\nISBN : 978-2-37840-027-9', '3500', '3000', 'Sélectionner une catégorie', 'Sujets SVT BAC, série D, de 2000 à 2015', 'Sujets SVT BAC, série D, de 2000 à 2015', 'Sujets SVT BAC, série D, de 2000 à 2015', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685123493.png', NULL, 0, 'Tabala Editions', '2019', 'q3oa4xdhms7d2tacg8l19rvipmnc966zewooif50jymt9uwfxr6zp1nka4rjbdnyz7ckk0fgwhbsxup0lg8elh23ijq2vt835veb', '2023-05-26 15:51:34', '2023-05-26 15:51:34'),
(12, 'Lewis Caroll', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-079-8', '2500', '1900', '8', 'Alice au pays des merveilles', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Lewis Carroll, nom de plume de Charles Lutwidge Dodgson, est un romancier, essayiste, photographe amateur et professeur de mathématiques britannique, né le 27 janvier 1832 à Daresbury et mort le 14 janvier 1898 à Guildford.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685123796.png', NULL, 0, 'Tabala Editions', '2021', 'mtv4gd5wpu0h2tx9mfibjeasqzj1x3v6j6vkdpri8h92etb1u2aclw8plrneb1fgas4wcnd57k987o0ysxyycorli6hz3ufmzk47', '2023-05-26 15:56:37', '2023-05-26 15:56:37'),
(13, 'Hans Christian Andersen', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-080-4', '2500', '1900', '8', 'Le vilain petit canard', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Hans Christian Andersen, né le 2 avril 1805 à Odense et mort le 4 août 1875 à Copenhague, est un romancier, dramaturge, conteur et poète danois, célèbre pour ses nouvelles et ses « contes de fées ».', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685124087.png', NULL, 0, 'Tabala Editions', '2021', 'maxis4j07ghidry1hwyotbp2t2wofiap3tzvdblesdc9kezn6p4u16f5ecv7jj5m80lqklymr46952uhf7avnrxz1c338gqk8bnx', '2023-05-26 16:01:28', '2023-05-26 16:01:28'),
