(11, 'Bernard Dadié', '256', '2000', '2350', 18, 'Un nègre à Paris', 'La 4ème de couv. indique : \"Dès sa parution, Un Nègre à Paris annonçait une ouverture de la conscience africaine sur le monde occidental que Bernard Dadié devait, par la suite, enrichir dans Patron de New York et La ville où nul ne meurt. .', 'Bernard Dadié est un écrivain, académicien et homme politique ivoirien né à Assinie au sud de la Côte d\'Ivoire le 10 janvier 1916 et mort le 9 mars 2019 à Abidjan.', 'http://tabalaeditions.com/media/pdf/pdf1669826985.pdf', 'http://tabalaeditions.com/media/couverte1/couverte11669826985.jpg', 'http://tabalaeditions.com/media/couverte/couverte1669826985.jpg', NULL, NULL, 'q19673hxf96ygbcjtxtcou6i4eroeuh01vdpf9gxobyzly3zvaw2sm4spqnann15h808pq7cjrll238rkamsk2dfbjvk0g5m75id', '2022-11-30 16:49:45', '2022-11-30 16:49:45'),
(12, 'Belin éditeur', '97', '2000', '2000', 16, 'Mon cahier de dictées', 'catalogue, éditions Tabala et Belin, méthode Boscher, Mon cahier de dictées, CE1', 'Belin éditeur est une maison d\'édition française, fondée en 1777 et spécialisée dans les ouvrages universitaires, scolaires et parascolaires.', 'http://tabalaeditions.com/media/pdf/pdf1669827149.pdf', 'http://tabalaeditions.com/media/couverte1/couverte11669827149.jpg', 'http://tabalaeditions.com/media/couverte/couverte1669827149.jpg', NULL, NULL, 'femtyxo0iwgvs98c3dyszib26nkr5eg5qjgd7tzap7w1839l4vlpao8ju4fhjprnfokhi1bnxmlas2czmqub1kc4yw3290hed7t0', '2022-11-30 16:52:29', '2022-11-30 16:52:29'),
(13, 'Bernard Dadié', '187', '3000', '1850', 18, 'Légendes africaines', 'Légendes africaines de Bernard B. Dadié. B. Dadié ne procédera pas autrement dans ses contes, lui dont les préoccupations seront morales autant que sociales .', 'Bernard Dadié est un écrivain, académicien et homme politique ivoirien né à Assinie au sud de la Côte d\'Ivoire le 10 janvier 1916 et mort le 9 mars 2019 à Abidjan.', 'http://tabalaeditions.com/media/pdf/pdf1669827362.pdf', 'http://tabalaeditions.com/media/couverte1/couverte11669827362.jpg', 'http://tabalaeditions.com/media/couverte/couverte1669827362.jpg', NULL, NULL, 'zcs6oy1tp3duv8m348ou9ce6tjb25gdk5bfzw171hgbvma43lxn2eada7x7xu0rilqe9gocpf890nyf5jrwwpkz4qk6j0lmiqvsy', '2022-11-30 16:56:02', '2022-11-30 16:56:02'),
(14, 'Belin éditeur', '58', '2000', '2000', 16, 'Mon cahier de dictées', 'catalogue, éditions Tabala et Belin, méthode Boscher, Mon cahier de dictées, CE2,', 'Belin éditeur est une maison d\'édition française, fondée en 1777 et spécialisée dans les ouvrages universitaires, scolaires et parascolaires.', 'http://tabalaeditions.com/media/pdf/pdf1669827499.pdf', 'http://tabalaeditions.com/media/couverte1/couverte11669827499.jpg', 'http://tabalaeditions.com/media/couverte/couverte1669827499.jpg', NULL, NULL, '61nzgqg2fkecy9aqr19utsjxnaadyit5dotzmpuy65vx780u9xng43show3q7f3wec4di0zs52pc8jjo84hrlkkbvmv60llp2rfh', '2022-11-30 16:58:19', '2022-11-30 16:58:19'),
(16, 'Belin éditeur', '187', '3000', '2000', 16, 'Mon cahier de dictées', 'catalogue, éditions Tabala et Belin, méthode Boscher, Mon cahier de dictées, CM1', 'Belin éditeur est une maison d\'édition française, fondée en 1777 et spécialisée dans les ouvrages universitaires, scolaires et parascolaires.', 'http://tabalaeditions.com/media/pdf/pdf1669828059.pdf', 'http://tabalaeditions.com/media/couverte1/couverte11669828059.jpg', 'https://edition.alerte-info.net/media/couverte/couverte1669828059.jpg', NULL, NULL, 'pt4mvh15vzbqighpqseyjkpaeg99m7f1qhn2cvt95r3zxbw3owzoarlouwkrng167xuu5il68jdexdd0sys40ff0y88lkjm762a3', '2022-11-30 17:07:39', '2022-11-30 17:07:39'),
(17, 'Belin éditeur', '56', '3000', '2000', 16, 'Mon cahier de dictées', 'catalogue, éditions Tabala et Belin, méthode Boscher, Mon cahier de dictées, CM2', 'Belin éditeur est une maison d\'édition française, fondée en 1777 et spécialisée dans les ouvrages universitaires, scolaires et parascolaires.', 'http://tabalaeditions.com/media/pdf/pdf1669828156.pdf', 'http://tabalaeditions.com/media/couverte1/couverte11669828156.jpg', 'https://edition.alerte-info.net/media/couverte/couverte1669828156.jpg', NULL, NULL, 'bd18plv7jt94qg46f7myzpqkar0hjd06fiw8eg2swyx33tsujuovi2lobhtn4f1n3cxa5lxzqmc9zcuy5weog81sbki65k72vdem', '2022-11-30 17:09:16', '2022-11-30 17:09:16'),
(21, 'Djeynab Hane-Diallo', 'Année d\'édition : 2022\r\nFormat d\'impression : 19,5 x 27cm\r\nNombres de pages : 64 pages\r\nISBN :  978-2-37840-006-4', '3500', '3000', 16, 'La Gentille et la Méchante (version scolaire)', 'Un conte dont la morale ne fait l’ombre d’aucun doute. Il faut penser à faire du bien. Car le bien triomphe toujours du mal.', 'Anciennement journaliste et responsable de communication dans une entreprise bien cotée, Djeynab Hane Diallo vient d’ajouter une autre corde à son arc et elle se dit \"fière d’apporter son imagination dans la vie des enfants\" à qui elle dédie son premier livre de conte. \"Dans cette vie d’ordinateur, d’internet et de hastag, je vous propose une pause avec ce livre\" a fait savoir l’auteur de \"La gentille et la Méchante\".', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683130683.png', NULL, NULL, NULL, 'ly5g1ug0o6xwrp4shwtdkphsez2ji7en906i22vedvsgq6awoy8k4fb789pybx3fmqtmajrqhzcnnlc0fi5l3ov1x839zjr1dm7u', '2023-05-03 14:18:04', '2023-05-03 14:18:04'),
(22, 'Hector Malot', 'Année d\'édition : 202\r\nFormat d\'impression : 11 x 18cm\r\nNombres de pages : 86 pages\r\nISBN :   978-2-3784-051-4', '3000', '2500', 16, 'Sans Famille', 'Roman français d’Hector Malot : l’histoire au 19ème siècle de Rémi, enfant abandonné, vendu pas ses parents adoptifs à un saltimbanque, Vitalis. Parcourant les routes françaises et anglaises, Rémi exerce différents métiers avant de découvrir le secret de ses origines.', 'Hector-Henri Malot dit Hector Malot, né le 20 mai 1830 à La Bouille, non loin de Rouen, et mort le 18 juillet 1907 à Fontenay-sous-Bois, est un romancier français. Malot a commencé sa carrière comme journaliste et écrivain en publiant des articles dans divers journaux et revues.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683133856.jpg', NULL, NULL, NULL, 'rw7uh943zf1l5d4anl1jat786ms2b2qkf6ommckn99e7iiqq8kyredzoac0pp1uvs205uwvroyzf35spcbg3hn8byvtjhidgexjx', '2023-05-03 15:10:57', '2023-05-03 15:10:57'),
(23, 'Baudelaire', 'Année d\'édition : 2021\r\nFormat d\'impression : 11 x 18cm\r\nNombres de pages : 86 pages\r\nISBN : 978-2-37840-054-5', '3000', '2500', 16, 'Les Fleurs du Mal', 'Un recueil de poésie qui a fait scandale en 1857 et qui marque l’histoire littéraire française. Baudelaire explore les thèmes de la solitude, de la maladie et de la dépression.', 'Charles Baudelaire, né le 9 avril 1821 à Paris et mort dans la même ville le 31 août 1867, est un poète français.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683136218.jpg', NULL, NULL, NULL, 'u453pg9ecjvmfrbuk7koxewcc0yaxpfa2foehzq9mlinty4yk35ig2bl9twdqiwo0nx6s1v7m3zrsg1678bur5zp4aqnjt81d8jv', '2023-05-03 15:50:19', '2023-05-03 15:50:19'),
(26, 'Guy de Maupassant', 'Année d\'édition : 2021\r\nFormat d\'impression : 11 x 18cm\r\nNombres de pages : 86 pages\r\nISBN : 978-2-37840-053-8', '3000', '2500', 16, 'Cinq contes', 'A la découverte de la vie paysanne au 19ème siècle…', 'Guy de Maupassant est un écrivain et journaliste littéraire français né le 5 août 1850 au château de Miromesnil à Tourville-sur-Arques et mort le 6 juillet 1893 dans le 16ᵉ arrondissement de Paris.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683212266.jpg', NULL, NULL, NULL, 'oik2e0pc0kzsifmufb179omqgys1dyxkyjaxwvhbb394l7jj2qvg9rthwlq8toucdg8znl58vzp6dpnear4x164mai6re3t25fsh', '2023-05-04 12:57:46', '2023-05-04 12:57:46'),
(27, 'Alexandre Dumas', 'Année d\'édition : 2021\r\nFormat d\'impression : 11 x 18cm\r\nNombres de pages : 86 pages\r\nISBN : 978-2-37840-052-1', '3000', '2500', 16, 'La Tulipe noire', 'Roman sur fond d’intrigues de la découverte d’une nouvelle espèce de tulipe.', 'Alexandre Dumas est un écrivain français né le 24 juillet 1802 à Villers-Cotterêts et mort le 5 décembre 1870 au hameau de Puys, ancienne commune de Neuville-lès-Dieppe, aujourd\'hui intégrée à Dieppe.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683212420.jpg', NULL, NULL, NULL, 'wh4k3d0cw2eogj62bc49rf013r9uyyuica0eoah5n6z9sxlniqxpjljlp6vytfvqhmk4dsx53mkgqp8uzia7zm8rbgw8defs72n1', '2023-05-04 13:00:21', '2023-05-04 13:00:21'),
(28, 'Coulibaly Yédiéti Édouard', 'Année d\'édition : 2014\r\nFormat d\'impression : 14,5 x 20,5cm\r\nNombres de pages : 128 pages\r\nISBN :', '6000', '3000', 21, 'Taudis du Bonheur (version scolaire)', 'Ce recueil de poèmes est l’hommage que rend le fils René Yédieti à son père, Coulibaly Yédieti Edouard, dix ans après la disparition de celui-ci. Pendant douze ans, le géniteur a fait parler discrètement sa plume. Celle-ci est devenue audible grâce à un ensemble de poèmes regroupés sous le titre de ‘’ Taudis du bonheur’’.', 'Ce recueil de poèmes est l’hommage que rend le fils René Yédieti à son père, Coulibaly Yédieti Edouard, dix ans après la disparition de celui-ci.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683212749.png', NULL, NULL, NULL, 'b5b1hcndwvj9sq87pr0yeh50n2wvy3uz9daktrp54rqpq31kfy4068kjvmefssxm7cifdij74gbc38elio19nm6zagtzlxwulh22', '2023-05-04 13:05:49', '2023-05-04 13:05:49'),
(29, 'Faustin Toha', 'Année d\'édition : 2012\r\nFormat d\'impression : 17 x 12cm\r\nNombres de pages : 138 pages', '6000', '5000', 1, 'L’houphouëtisme en 100 citations', 'Un livre document consacré à cent extraits de discours du premier président ivoirien Félix Houphouët-Boigny. Six principales pensées traduites en baoulé, bété et malinké. La traduction complète des pensées en anglais.', 'Directeur de Tabala Editions et écrivain.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683307241.png', NULL, NULL, NULL, 'cnuf60acq34ae5gnhly20y9blackoi66htqkjs2q71803o9ti94zvse7yvzijxr7ojvmhn8w21frgswdlbuzdpxpbdtmem48k15g', '2023-05-05 15:20:42', '2023-05-05 15:20:42'),
(30, 'Faustin Toha', 'Année d\'édition : 2015\r\nFormat d\'impression : 15 x 23,5cm\r\nNombres de pages : 118 pages\r\nDépôt légal n° 11719', '15000', '10000', 1, 'Henri Konan Bédié, Appel de Daoukro, Ma vie, servir la Côte d’Ivoire', 'Propos d’un homme d’Etat qui, aujourd’hui comme hier, met les intérêts de la Côte d’Ivoire au-dessus des ambitions personnelles ou partisanes.', 'Directeur de Tabala Editions et écrivain', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683307454.jpg', NULL, NULL, NULL, '83tu4kwnbvaboqtqdisahfnhjet5npg2rqeg9cm6xzccjejpvd1bh0zlozk0vkradu71mr59yy8luigw79f7l4oy4s0f3ws6262x', '2023-05-05 15:24:14', '2023-05-05 15:24:14'),
(31, 'Serge Amissah', 'Année d\'édition : 2018\r\nFormat d\'impression : 14,5 x 22cm\r\nNombres de pages : 232 pages\r\nISBN : 979-10-2622-154-8', '6000', '5000', 1, 'Tourner la page', 'De l’indépendance aux années 2000, cet essai didactique met en lumière tout à la fois les atouts et les changements nécessaires à la nation ivoirienne pour trouver la voie d’un véritable développement autonome.', 'Serge Amissah est entrepreneur en série et consultant indépendant.\r\nIl est actuellement dirigeant et/ou administrateur de plusieurs entreprises en Afrique de l\'Ouest.\r\nPassionné par l\'agriculture, l\'entrepreneuriat et les défis liés au développement de son pays, il est également auteur de CÔTE D\'IVOIRE: TOURNER LA PAGE, un essai économique qui présente une voie alternative pour un progrès économique et social durable dans ce pays.\r\nSerge est diplômé de l’École Supérieure de Commerce d’Abidjan (l’ESCA) et de The Wharton School, University of pennsylvania.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683307716.png', NULL, NULL, NULL, 'zsmou24cj6wxw7ao2qlvtacszlnblk86iqcz2bpdjw57enr0hpadt9k5ey8fb4giipx7v5smd3gu8hxtr311hf9ygn40efmvkqr6', '2023-05-05 15:28:36', '2023-05-05 15:28:36'),
(32, 'Simone Ehivet Gbagbo', 'Année d\'édition : 2021\r\nFormat d\'impression : 16,5 x 22,5cm\r\nNombres de pages : 346 pages\r\nISBN : 978-2-37840-055-2', '8000', '5000', 1, 'Ma sortie de prison, prémices d’une Côte d’Ivoire réconciliée', 'Simone Ehivet Gbagbo livre des paroles fortes dites après sa libération, pendant ses premiers moments de communion avec les populations ivoiriennes dans toutes leurs diversités, et dévoile également quelques fruits de sept années d’introspection et d’analyse.', 'Simone Ehivet Gbagbo, née le 20 juin 1949 à Moossou, est une syndicaliste et femme politique ivoirienne. Membre fondatrice du Front populaire ivoirien, députée dans les années 1990 et 2000, elle est vice-présidente de l\'Assemblée nationale de 1995 à 2000.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683307863.png', NULL, NULL, NULL, 'nfhyk7bpxue8w8w3o5q6sm93lj18z41pr0jlbelfwfkqmg025azg626eystpdr0hx1ih7aud7m95gztkc2rcx4sa9ut43vnoivoj', '2023-05-05 15:31:04', '2023-05-05 15:31:04'),
(33, 'Dr. Simone Ehivet Gbagbo & Dominique ThalmasTayoro', 'Année d\'édition : 2023\r\nFormat d\'impression : 15 x 21cm\r\nNombres de pages : 400 pages\r\nISBN : 978-2-37840-068-2', '12000', '10000', 1, 'Du « sous-sol de la République » à la restauration', 'Récit de Dr Simone Ehivet Gbabgo des temps forts de sa détention du mois d’avril 2011 au mois d’août 2018. L’on y découvre une prisonnière remplie de foi en Dieu, complètement guérie de ses blessures intérieures et qui, par moment, affronte courageusement la mort et son destin…', 'Simone Ehivet Gbagbo, née le 20 juin 1949 à Moossou, est une syndicaliste et femme politique ivoirienne. Membre fondatrice du Front populaire ivoirien, députée dans les années 1990 et 2000, elle est vice-présidente de l\'Assemblée nationale de 1995 à 2000.\r\n\r\nRegine Dominique Suz Thalmas-Tayoro. Spécialiste en communication, Journaliste et Juriste.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683308052.png', NULL, NULL, NULL, '3701gcy2wnpehfyv4v3ztqwy18a6mcb0dxlr4ki7enl1gbfr4oleuohvs6nikwr8ksz9mjzqg25d9c257mtbjxioxj5pd6ufapqs', '2023-05-05 15:34:14', '2023-05-05 15:34:14'),
(34, 'Joël N’guessan', 'Année d\'édition : 2021\r\nFormat d\'impression : 17 x 22,5cm\r\nNombres de pages : 532 pages\r\nISBN : 978-2-37840-059-0', '17500', '15000', 1, 'Porter la parole, un sacerdoce', 'Dans ce livre mémoriel, Joël N’Guessan retrace des années de prise de parole au service du RDR et de ses dirigeants. Le Professeur Henriette Dagri Diabaté qui l’a préfacé, y voit plus que le témoignage d’un homme engagé au service de la République, plutôt « une invite à feuilleter nos vies individuelles et collectives ».', 'Joël N’Guessan, président du Comité de gestion du Fonds de développement de la formation professionnelle… ancien ministre des Droits de l’homme, un parcours exceptionnel pour une personne atteinte d’un handicap physique', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683308214.png', NULL, NULL, NULL, 'g0ujl8pas09nvoa63wmy5flljefjc4svktv2xchwhtna65zzb67yerephkkmg7oztq89md021biqddripux9cogqy184w2ri73b4', '2023-05-05 15:36:55', '2023-05-05 15:36:55'),
(35, 'Camara Loukimane', 'Année d\'édition : 2022\r\nFormat d\'impression : 13,5 x 21,5cm\r\nNombres de pages : 244 pages\r\nISBN : 978-2-37840-026-2', '7000', '6000', 1, 'L’Éléphant braqué', 'Critiques et actions majeures proposées par l’auteur pour rompre avec la politique du cavalier et du cheval qui a toujours caractérisé les relations entre la France et l’Afrique francophone.', 'Camara Loukimane est Sup de Co, expert financier. Il a dirigé la Société ivoirienne de construction et de gestion immobilière (Sicogi). Il est Député à l\'Assemblée Nationale de Côte d\'Ivoire. Il est déjà l\'auteur de Marché, gouvernance et pauvreté : le cas de la Côte d\'Ivoire. Koulniema, le bonheur de dire non est sa première incursion dans le genre romanesque.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11683308428.png', NULL, '2022', 'Tabala', '6uef9lc6cahmz35xwoocp40nox6d3jsj8kgh2x20b4eb3e4z072wyaljplvqw11rfutyts1dp5zqvn7tnbqkgi795mmksdri9ia8', '2023-05-05 15:40:29', '2023-05-05 15:40:29'),
(36, 'Norberte Zézé', 'Année d\'édition : 2022\r\nFormat d\'impression : 13 x 21cm\r\nNombres de pages : 176 pages', '7000', '5000', 5, 'Mère seule, femme épanouie… \"Comment j’ai élevé mes enfants\"', 'Une expérience personnelle de Norberte Zezé  dans ce monde moderne de toutes tentations où  les mères sont  confrontées  à l’échec de leurs enfants avec la criante de rater leur éducation.', 'Chef de division communication chez ANADER. ANADER.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685117452.png', 'https://www.tabalaeditions.com/media/couverte/couverte1685117453.png', '2022', 'Tabala Editions', 'j0fmz5xcz6gf0v7de4xckhnl1uodk2v3q97t87q15ygp819wr2e4las4j20hi8qswl3buurwm5vica9i3ykonpoapjdtxrs6tmfz', '2023-05-26 14:10:54', '2023-05-26 14:10:54'),
(37, 'Bilal Zouhair', 'Année d\'édition : 2022\r\nFormat d\'impression : 14,5 x 20,8 cm\r\nNombres de pages : 486 pages', '10000', '5000', 5, 'SHALL, le chant des sirènes', '« Elle m’avait convaincu qu’elle était La Perfection et qu’elle dispensait un bonheur infini à tous ceux qui l’écoutaient. Dès qu’elle nous appelait, nous nous dirigions vers la cité pour nous ravitailler. C’était cela notre vie. La risquer en volant, voler pour se droguer et se droguer pour mourir… »\r\nUne réalité que vous devez connaître pour protéger vos enfants contre cette tentation !', 'Bilal Zouhair', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685117621.jpg', 'https://www.tabalaeditions.com/media/couverte/couverte1685117622.jpg', '2022', 'Tabala Editions', '3hrnv6izsmwvo77xghpc88ayeklqvyoa5anpm1dfqiikf81tbk5l3rod2tbr2ce4uw4cdjmb2f53uzgj0w9p9h9uslye71nstx4q', '2023-05-26 14:13:42', '2023-05-26 14:13:42'),
(38, 'Diby Kouamé Silvain', 'Année d\'édition : 2018\r\nFormat d\'impression : 14 x 22cm\r\nNombres de pages : 220 pages\r\nISBN : 978-2-37840-004-0', '1000', '5000', 14, 'L’espoir africain', 'Cet ouvrage est une réflexion sur la solution spirituelle des maux sociopolitiques de l’Afrique subsaharienne qui la conduira  à l’émergence et au développement.', 'DIBY Kouamé Silvain\r\nChercheur privé et Ecrivain', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685117941.png', NULL, '2018', 'Tabala Editions', '119qax544fhg8iag53zmnarp35b1qhlqn6tv00yxtsteiikcrr2c4pfg9swjhyecyob3v6fzm7kpuj0dbve72nd8ul6ojwx8kl27', '2023-05-26 14:19:02', '2023-05-26 14:19:02'),
(39, 'Jacqueline Louhoues-Oble', 'Année d\'édition : 2018\r\nFormat d\'impression : 15 x 24 cm\r\nNombres de pages : 370 pages\r\nISBN :', '18000', '15000', 3, 'Le Droit ivoirien des successions', 'Cet ouvrage s’adresse aux étudiants en droit, aux praticiens, spécialement aux notaires,  magistrats et avocats ainsi qu’aux agents des services de l’enregistrement et chefs d’entreprise. Mais il s’adresse aussi au citoyen lambda qui a des interrogations sur la question importante des successions. C’est pourquoi, bien que portant sur une matière « ardue », cet ouvrage a été écrit dans un langage accessible à tous, et dans une perspective à la fois théorique et pratique.', 'Anne Jacqueline Lohouès Oble est une femme politique ivoirienne. En décembre 2010, elle était la porte-parole de l\'ancien président Laurent Gbagbo. Du 5 décembre 2010 au 11 avril 2011, elle est ministre de l\'éducation nationale dans le gouvernement Aké N\'Gbo qui n\'a pas été reconnu par la communauté internationale.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685118250.png', NULL, '2018', 'Tabala Editions', 'vgpqcsa5hv0qkocdybdjkrjrml7mr26sniu953guw4hct1wgf8a2nzf8zub1k7qee3hl96ixsxo14n06px7d28vm9ifet0pz4wj3', '2023-05-26 14:24:11', '2023-05-26 14:24:11'),
(40, 'Dieyna Barry', 'Année d\'édition : 2015\r\nFormat d\'impression : 28,5 x 24 cm\r\nNombres de pages : 80 pages\r\nISBN : 978-2-9543653-0-8', '23000', '20000', 6, 'Amazones Contemporaines', '« La femme africaine fascine le monde par sa beauté, son courage et son élégance, elle a façonné l’Afrique par ses qualités exceptionnelles » affirme Dieyna Barry.\r\nCette singulière présence féminine est mise en lumière dans ce beau livre à travers les différents pays de l’UEMOA avec un réel sens de l’évocation, voire de l’interpellation.', 'Dieyna Barry\r\nPanafricaniste dans l\'âme, à travers cette série de photographies artistiques Dieyna Barry rend hommage aux femmes africaines.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685118580.png', NULL, '2015', 'Tabala Editions', '4hsvzut6o1elvdpgxlbxbsa9g9h6iyc0anwr28fhjiy6fycxdzw7019vo8z4c2esmtolf78aj55t3mk1k3bjqnr4i20q3q7duepr', '2023-05-26 14:29:40', '2023-05-26 14:29:40'),
(41, 'Stéphane Blé', 'Année d\'édition : 2014\r\nFormat d\'impression : 21 x 21 cm\r\nNombres de pages : 84 pages\r\nISBN :', '20000', '17000', 6, 'Stéphane Blé, 35 oeuvres, 2012-2014', 'Selon Serge Martinez, l’oeuvre de Stéphane Blé, artiste peintre et sculpteur franco-ivoirien, est inclassable, elle n’appartient ni au Street Art, ni au cubisme, ni à l’impressionnisme, ni à l’abstrait, elle se réinvente sans cesse dans un cocktail éclatant de couleurs.', 'Stéphane Blé.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685119174.png', NULL, '2014', 'Tabala Editions', 'esidj2abymy4781kxlltue4ch6psudr6vkuhzex51603fbw75tg0oqxp9oij2akfgvf213iyvohc587wrtwmg4qs8r0n3ajnmqpl', '2023-05-26 14:39:36', '2023-05-26 14:39:36'),
(42, 'Werewere Liking', 'Année d\'édition : 2019\r\nFormat d\'impression : 25 x 29,5 cm\r\nNombres de pages : 352 pages\r\nISBN : 978-2-37840-038-5', '35000', '30000', 6, 'L’Eternelle Reine, 50 ans de poésie et de peinture', '50 ans  de peinture et de poésie. Créatrice pluridisciplinaire, Werewere Liking  est l\'Éternelle Reine qui a su dompter l’art sous toutes ses formes. Ce beau livre est un chef-d\'œuvre.', 'Eddy Njock Liking plus connue sous le nom de Werewere-Liking Gnepo est une écrivaine, poétesse, chorégraphe et peintre camerounaise, née le 1ᵉʳ mai 1950 à Douala et installée en Côte d\'Ivoire. Elle est la fondatrice du groupe Ki Yi M\'Bock, compagnie de théâtre basée à Abidjan.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685119712.png', NULL, '2019', 'Tabala Editions', 'xrkrh0ybw3jir5t8zxvpzlf9kno16dod5tkjq0gt8px7gcsuualv27fblmiafude266iqnm35ycp1vwg2hwoshb3qz8enays7m41', '2023-05-26 14:48:35', '2023-05-26 14:48:35'),
(43, 'Stefan Meisel', 'Année d\'édition : 2014\r\nFormat d\'impression : 21 x 29,7 cm\r\nNombres de pages : 216 pages\r\nDépôt légal N°11258', '55000', '50000', 6, 'Abidjan Art Festival, Artistes visuels contemporains en et de la Côte d’Ivoire', 'Ce catalogue d’Abidjan Art Festival offre un panorama de l’art contemporain en Côte d’Ivoire, en 2014, à travers les œuvres, portraits et biographies de plus de 120 artistes d’origine ivoirienne ou vivant en Côte d’Ivoire.', 'Steven Meisel, né en 1954 à New York, est un photographe américain popularisé par son travail dans les éditions américaine et italienne du magazine Vogue.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685119910.png', NULL, '2014', 'Tabala Editions', 'lhdorgpvkqqc02e43nbd800tdisx8pfyv6bg2ykwfcmju5jl7r33zr1pz775jm8gt1iuqhxay4hlnae1nf95uwx6sa9z4s9e2v6c', '2023-05-26 14:51:50', '2023-05-26 14:51:50'),
(44, 'Épiphane Zoro BI', 'Année d\'édition : 2016\r\nFormat d\'impression : 13,8x21 cm\r\nNombres de pages : 150 pages\r\nISBN : 978-2-37840-010-1', '4000', '3500', 26, 'Adieri la prisonnière', 'Ce roman est le récit d’un parcours et d’un rêve brisé d’une jeune fille qui voulait servir ses frères et sœurs en tant qu’infirmière, rêve brisé par la situation en Ituri.', 'Epiphane Zoro Bi Ballo, né le 11 janvier 1968 à Sinfra dans le Centre-Ouest de la Côte d\'Ivoire, est un homme politique ivoirien. Magistrat de formation, il est l\'actuel Ministre de la Promotion de la bonne gouvernance, du renforcement des capacités et de la lutte contre la corruption de Côte d\'Ivoire.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685120159.png', NULL, '2016', 'Tabala Editions', 'lo2g7jcz0x4a4dpnnwj9fsh1ua08gi5tv26u83dxlqtqm9806dxapoimnw7y6cbebhl7fviy9ve1re2rufhoyjck5wk4bksgqms3', '2023-05-26 14:56:00', '2023-05-26 14:56:00'),
(46, 'Awaba', 'Année d\'édition : 2016\r\nFormat d\'impression : 11,5x17 cm\r\nNombres de pages : 220 pages\r\nDépôt légal n°12852', '3500', '2900', 26, 'Des Femmes et des Omelettes', 'Dix-neuf nouvelles qui parlent de vous et de votre entourage.', 'J’ai fais mon école primaire et collège en Côte d’Ivoire. Le lycée et l’université en Guinée à Koffi Annan, où j’ai obtenu ma licence en Communication. Puis je pars à Paris pour faire une autre licence en Communication avant de retourner à Abidjan, pour un master en Intégration Africaine et Diplomatie.\r\n\r\nAvant de quitter la Guinée, en 2010 d’abord Je portes la couronne de Miss Koffi, ensuite en 2011 j’ai été Miss Conakry et deuxième dauphine Miss Guinée, la même année.\r\nAu delà de l’événementiel,je suis passionné de cuisine , de l’art de la table et le relooking.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685120838.png', NULL, '2016', 'Tabala Editions', 'us1tpymcv95co60rqmap0zmlp80knwtxdd2ed8qbyvng1fwa4jh13xle3uic4295sy29bkotlfzoabe3qfu6g65jwk7rzgx7jr7s', '2023-05-26 15:07:19', '2023-05-26 15:07:19'),
(47, 'Macaire Etty', 'Année d\'édition : 2018\r\nFormat d\'impression : 11x17,5 cm\r\nNombres de pages : 112 pages\r\nISBN : 978-2-37840-017-0', '3000', '2500', 26, 'Saramani, l’épopée interdite', 'Cette épopée met en lumière le rôle que la princesse Nana Triban a joué dans la libération du Manding, pris dans les serres de la tyrannie de Soumangourou Kanté, roi des Sossos.', 'Macaire Etty est un écrivain et homme de lettres ivoirien. Enseignant de formation, il est né en 1967 à Bocanda, localité située dans le Centre-Est de la Côte d\'Ivoire.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685120963.png', NULL, '2018', 'Tabala Editions', 'ykhvbz8ri20t92so5inp0ypbz3u66l7kmnp4aoxlrdmfgedj5wgqv4c3cdufqvsewh541s70tjfaxbqjnuc2a6m3weyxhit1l9rz', '2023-05-26 15:09:24', '2023-05-26 15:09:24'),
(48, 'Yacouba Sylla', 'Année d\'édition : 2019\r\nFormat d\'impression : 14x19,5 cm\r\nNombres de pages : 52 pages\r\nISBN : 978-2-37840-020-0', '2500', '2000', 26, 'Les filles de Gagnoa', 'Un récit qui milite en faveur de l’égalité de genre, de la scolarisation des filles…', 'L’écrivain Yacouba Sylla, auteur de l’œuvre ‘’Les Filles de Gagnoa’’ et président de l\'Ong \'\'Lire et Savoir au Tunnel de la Fraternité\" (Lisaf), était le week-end dernier, l’invité spécial, de l’Association des femmes dynamiques du village de Bahébé (Afdb) dans le département de Duékoué, dans l’Ouest de la Côte d’Ivoire.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685121150.png', NULL, '2019', 'Tabala Editions', 'nuf7pzylo12gyf5gj6h9llaq2wixemvt3eczdph8s554nvjfw0yektmd9i170v7bdog3mn29krihaoskcbaq14sbjpucxzrrx83t', '2023-05-26 15:12:31', '2023-05-26 15:12:31'),
(49, 'Laure Olga Gondjout Avec Djeynab Hanne-Diallo', 'Année d\'édition : 2020\r\nFormat d\'impression : 14x22,3 cm\r\nNombres de pages : 240 pages\r\nISBN : 978-2-37840-057-6', '7500', '7000', 26, 'Instants de vie, Omar Bongo, les miens et le monde', 'Laure Olga Gondjout, née le 18 décembre 1953 à Paris, est une femme politique gabonaise, ministre des Affaires étrangères du 6 février au 9 octobre 2008.\r\n\r\nAnciennement journaliste et responsable de communication dans une entreprise bien cotée, Djeynab Hane Diallo vient d’ajouter une autre corde à son arc et elle se dit \"fière d’apporter son imagination dans la vie des enfants\" à qui elle dédie son premier livre de conte. \"Dans cette vie d’ordinateur, d’internet et de hastag, je vous propose une pause avec ce livre\" a fait savoir l’auteur de \"La gentille et la Méchante\".', 'Laure Olga Gondjout a occupé  au Gabon les postes de Secrétaire particulière du président Omar Bongo, Ministre délégué aux Affaires Etrangère, Secrétaire Générale  de la Présidence, Médiateur de la République. A présent, elle plonge dans ses souvenirs pour en tirer des leçons.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685121351.png', NULL, '2020', 'Tabala Editions', 'arewoj38o9663wkpkblm1y62d1mzcfda9txedfx85v024vhgfis0wq5okysmtr20pc1pia8tx5zusn7qhiecb3hg4ny49vjqn7uu', '2023-05-26 15:15:52', '2023-05-26 15:15:52'),
(50, 'Faustin Toha', 'Année d\'édition : 2019\r\nFormat d\'impression : 18x11 cm\r\nNombres de pages : 184 pages\r\nISBN : 978-2-37840-030-9', '3500', '3000', 26, 'Le pont de la honte', 'Une fiction pleine de bourrasques. Le tout est de mieux cerner le personnage inédit d’un adolescent dont le rôle est de désarmer des protagonistes puissamment armés.', 'Faustin Toha\r\nAncien Directeur de Communication au Port Autonome d\'Abidjan, aujourd\'hui Directeur des éditions à Tabala Editions, écrivain de plusieurs oeuvres.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685121622.png', NULL, '2019', 'Tabala Editions', 't8ja5k8s79hjxmd28q54mr27efvrd6kiapo20sngztmlqvpwh91gkzwyhb7cacgted4bx1f9yn3rwup6jxl1uc4y0nlooeizq3bf', '2023-05-26 15:20:22', '2023-05-26 15:20:22'),
(51, 'Werewere Liking', 'Année d\'édition : 2021\r\nFormat d\'impression : 15x21,5 cm\r\nNombres de pages : 128 pages\r\nISBN :', '8000', '7000', 26, 'Le testament de Mima', 'L’histoire se déroule en 2040. Mais les pseudos Nobles ou Sages sont tous aussi débiles qu’ils ne l’étaient auparavant. Rien à changer !', 'Eddy Njock Liking plus connue sous le nom de Werewere-Liking Gnepo est une écrivaine, poétesse, chorégraphe et peintre camerounaise, née le 1ᵉʳ mai 1950 à Douala et installée en Côte d\'Ivoire. Elle est la fondatrice du groupe Ki Yi M\'Bock, compagnie de théâtre basée à Abidjan.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685121753.png', 'https://www.tabalaeditions.com/media/couverte/couverte1685121753.png', '2021', 'Tabala Editions', 'uyq3mo4tqe9kycv5igpoocisk36wl8m6vhfrucu8pkgnb28zjlfadgabtid1tr24p0yd9xs4fr6h3e7e5027wnqnvbsalw70x9z1', '2023-05-26 15:22:34', '2023-05-26 15:22:34'),
(52, 'Jean Blézon', 'Année d\'édition : 2018\r\nFormat d\'impression : 13,3x21 cm\r\nNombres de pages : 216 pages\r\nISBN : 978-2-37840-020-0', '4500', '4000', 26, 'Mal dans la peau', 'L’incivisme des populations est la résultante de celui des dirigeants.  Tout fonctionne mal.  Sous cette lourdeur chaude, on a mal dans la peau.', 'Arrivé en France en 1970, Jean Blézon a été administrateur d’entreprises. Il est autodidacte, président du Mouvement de solidarité démocratique dans la diaspora (MSD), basé en France. Aujourd’hui retraité, il se consacre à l’écriture et aux œuvres de Dieu.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685122169.png', NULL, '2018', 'Tabala Editions', 'h73f9qdihn3o6f45lasikng20so9ajqvrz6ywp1h9uvjzbk85p1rdi85cpf4v0gwwcm7ycg0kterjb32u1x4bo2e8mn6slaqmyzx', '2023-05-26 15:29:29', '2023-05-26 15:29:29'),
(53, 'Belettres Kwam', 'Année d\'édition : 2019\r\nFormat d\'impression : 11,5x18,5 cm\r\nNombres de pages : 128 pages\r\nISBN : 978-2-37840-032-3', '3000', '2500', 26, 'Abla Pokou ou le salaire d’une légende (théâtre)', 'Le contenu anecdotique d’une esquisse théâtrale qui montre que l’homme politique oublie trop vite que les leçons de l’histoire doivent servir le présent pour féconder un futur qui chante.\r\nL’histoire du peuple Akan qui doit sa survie au sacrifice du fils unique de la princesse Abla Pokou qui deviendra par la suite la reine « Abla Pokou ».', 'Belettres Kwam. Enseignant chez Centre national de paratélé enseignement.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685122446.png', NULL, '2019', 'Tabala Editions', 'x1t6pncqignkxfegqokj5z2evvwyil5u84f7l4vas3rmjc6u20402c1rs1pblyaf9d87zr6kdtsiu9hwbwatodq0ng3zy9oxp8m3', '2023-05-26 15:34:06', '2023-05-26 15:34:06'),
(54, 'Olivier Vamy Djé Bi Djé', 'Année d\'édition : 2022\r\nFormat d\'impression : 17,5x21 cm\r\nNombres de pages : 128 pages\r\nISBN : 978-2-37840-024-8', '3500', '3000', 26, 'Les fables de la buvette', 'Formidable alchimie qui mêle le nouchi, le trait poétique facétieux et la belle maitrise de la langue française. Toutes les générations seront séduites par cette œuvre.', 'DJE BI DJE Olivier Vamy · Maire de Zuenoula chez République de Côte D\'Ivoire', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685122609.png', NULL, '2022', 'Tabala Editions', '3oxvq9rin6ale3lp5bvpni44bkgpdfx2s7g601nth1wz5j782ody3rvqwzm6o9mfwyu8amaxthks51z8r0feuc9jqtckc7ygdhi0', '2023-05-26 15:36:50', '2023-05-26 15:36:50'),
(55, 'Lewis Caroll', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN :', '1900', '1900', 8, 'Alice au pays des merveilles', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Lewis Carroll, nom de plume de Charles Lutwidge Dodgson, est un romancier, essayiste, photographe amateur et professeur de mathématiques britannique, né le 27 janvier 1832 à Daresbury et mort le 14 janvier 1898 à Guildford.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685450244.png', NULL, '2021', 'Tabala Editions', 'qysdeagbrigbkda4qlu29v8ljo1m8esvpdx0qiy5o1yzx4phnt0k2r5clm63t3o3s2fugu7f01n4a8tchc6jkx997w7newvhzf6w', '2023-05-30 10:37:25', '2023-05-30 10:37:25'),
(56, 'Hans Christian Andersen', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-080-4', '1900', '1900', 8, 'Le vilain petit canard', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Hans Christian Andersen, né le 2 avril 1805 à Odense et mort le 4 août 1875 à Copenhague, est un romancier, dramaturge, conteur et poète danois, célèbre pour ses nouvelles et ses « contes de fées ».', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685450361.png', NULL, '2021', 'Tabala Editions', '5zps2r0ypa9e8ckdtaodg39xbjtzkq1hcibmptcx7mfnj605q14b5vxdhlvsmg2kqfee8azwnuv3h08j9uw6y1wys4nl72ugfo6r', '2023-05-30 10:39:22', '2023-05-30 10:39:22'),
(57, 'Alphonse Daudet', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-081-1', '1900', '1900', 8, 'La chèvre de monsieur Seguin', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Alphonse Daudet, né le 13 mai 1840 à Nîmes et mort le 16 décembre 1897 à Paris, est un écrivain et auteur dramatique français.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685451661.png', NULL, '2021', 'Tabala Editions', 'm6gesp4smlhl7o6tu5r57pw9hzg0u1xq3u1n41c2ftaaysyveqz2j8e9w9fhrpkb8zbdkmwjltdnio0iikbco56xynjq4dxa23v0', '2023-05-30 11:01:02', '2023-05-30 11:01:02'),
(58, 'James Matthew Barrie', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-082-8', '1900', '1900', 8, 'Peter Pan arrive', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Sir James Matthew Barrie, plus connu sous la signature de J. M. Barrie, 1ᵉʳ baronnet, né le 9 mai 1860 à Kirriemuir et mort le 19 juin 1937 à Marylebone est un écrivain et dramaturge écossais, célèbre pour avoir créé le personnage de Peter Pan. Il est surnommé par sa famille Jimmy ou Jamie.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685451845.png', NULL, '2021', 'Tabala Editions', 'a47i2e176x0rvxh813gfwqagjclh4jymhonmrsjundcisgtpuf51mb009833swlpiacunwtv9qb85tdr2kz9beqdo57yzfk6ovlp', '2023-05-30 11:04:06', '2023-05-30 11:04:06'),
(59, 'Hans Christian Andersen', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-083-5', '1900', '1900', 8, 'La petite Sirène', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Hans Christian Andersen, né le 2 avril 1805 à Odense et mort le 4 août 1875 à Copenhague, est un romancier, dramaturge, conteur et poète danois, célèbre pour ses nouvelles et ses « contes de fées ».', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685454455.png', NULL, '2021', 'Tabala Editions', 'i4qatwlbxmmaekfvpqh2h32gflad97ibp5dycu57rnh808roxvo6n8ewdrkccs69z1gqwpsfj46st1ymxgu4t0vyju79z3jinolk', '2023-05-30 11:47:36', '2023-05-30 11:47:36'),
(60, 'Frères Grimm', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-084-2', '1900', '1900', 8, 'Blanche Neige', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Wilhelm Carl Grimm est un conteur, linguiste, philologue allemand, connu pour avoir rassemblé des contes européens avec son frère Jacob et contribué à la rédaction du Deutsches Wörterbuch.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685458893.png', NULL, '2021', 'Tabala Editions', 'xb8np349nfr6ymqqitpisva1sfucwrvn308zyju0z726awkhogtjgj3yrdef9ueox0mbdes5o4m45kcgvllp812acz6h27qkdlx5', '2023-05-30 13:01:34', '2023-05-30 13:01:34'),
(61, 'Jeanne-Marie Leprince', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-085-9', '1900', '1900', 8, 'Belle découvre la bonté de la Bête', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Jeanne-Marie Leprince de Beaumont, née Marie-Barbe Leprince le 26 avril 1711 à Rouen et morte le 6 décembre 1776 à Avallon est une femme de lettres célèbre, souvent appelée à tort « Jeanne-Marie », double prénom qu\'elle n\'a jamais utilisé et qui ne figure dans aucun document officiel la concernant.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685459097.png', NULL, '2021', 'Tabala Editions', '1y4tb4hbds92gj6ovojshuype4ifq2i5r08fvtnmidu8awwwcjczq3dkxt06gnap6lhu1oa7vnmmycrxl3fe51pqb3xlkr7gs705', '2023-05-30 13:04:58', '2023-05-30 13:04:58'),
(62, 'Charles Perrault', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-086-6', '1900', '1900', 8, 'La belle Au Bois Dormant', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Charles Perrault, né le 12 janvier 1628 à Paris et mort dans cette même ville le 16 mai 1703, est un homme de lettres français, célèbre pour ses Contes de ma mère l’Oye.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685459257.png', NULL, '2021', 'Tabala Editions', '2qh2d8tzow7aigd3c50kqjefx4keg6zmyxbbz11iy7aox3ond8mhuwh6v0cppbs4l17ru6pvtnl8uc25elw49jv90smfsjfary5g', '2023-05-30 13:07:38', '2023-05-30 13:07:38'),
(63, 'Charles Perrault', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-087-3', '1900', '1900', 8, 'Cendrillon', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Charles Perrault, né le 12 janvier 1628 à Paris et mort dans cette même ville le 16 mai 1703, est un homme de lettres français, célèbre pour ses Contes de ma mère l’Oye.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685459399.png', NULL, '2021', 'Tabala Editions', 'blwrfvnpxn1q6u4yx7p49mvlfoyhi24kizositburjq21zx03e03c9y575ee3n18ca87jjsdka6ctdgwmz2hl0wfumqbt8hkgap9', '2023-05-30 13:10:00', '2023-05-30 13:10:00'),
(64, 'Robert Southey', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-088-0', '1900', '1900', 8, 'Boucle d\'or et les trois ours', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Robert Southey est un écrivain romantique anglais, auteur d\'une œuvre abondante et variée. Poète lauréat, il est avant tout célèbre pour sa poésie, mais il a également écrit de nombreuses biographies, dont celle de William Cowper, une histoire du Brésil et divers récits tels que Boucle d\'Or.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685459692.png', NULL, '2021', 'Tabala Editions', '7x83entrtxs95vr4qf7uzazk19nphih16z0o4mvshgli96n2cc53ta8yid3bdwkead8fjxuw2ocjlm2g0br5qe01vp4qgfumpbsl', '2023-05-30 13:14:53', '2023-05-30 13:14:53'),
