(73, 'Carlo Collodi', 'Année d\'édition : 2021\r\nFormat d\'impression : 17,5 x 23cm\r\nNombres de pages : 28 pages\r\nISBN : 978-2-37840-098-9', '1900', '1900', 8, 'Pinocchio', 'Cette collection présente des contes qui permettent aux enfants d’acquérir le goût de la lecture et facilitent l’acquisition du langage.', 'Carlo Lorenzini est un journaliste et écrivain italien. Critique dramatique en complément de son métier de fonctionnaire affecté à la censure, il est l\'auteur, sous le pseudonyme de Carlo Collodi, du chef-d\'œuvre mondial de la littérature enfantine Les Aventures de Pinocchio.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685462200.png', NULL, '2021', 'Tabala Editions', 'oae169t2mjiv4qcr6am5l4sk10nepk7w14if9yun9mz8phyqtwr5y65x08vuxj2z3sbac70djchxwrvhl37odz2gbbgoe3pnflf8', '2023-05-30 13:56:42', '2023-05-30 13:56:42'),
