INSERT INTO `ouvrages` (`id`, `name_auteur`, `ftechnique`, `prixbase`, `prixbas`, `category_id`, `titre`, `resume`, `bioauteur`, `oeuvre_pdf`, `couverture1`, `couverture2`, `an`, `edit`, `rfk`, `created_at`, `updated_at`) VALUES
(76, 'Nabou Fall', 'Année d\'édition : 2017\r\nFormat d\'impression : 14,5 x 21cm\r\nNombres de pages : 440 pages\r\nISBN : 978-2-37840-005-7', '8000', '7000', 26, 'Evasion Virtuelle', 'La perspective d’avoir accès à Internet ne fait pas qu’ouvrir une porte sur le monde.\r\nSon utilisation  peut sérieusement bouleverser la vie de tout un chacun.\r\nSurtout quand l’on a des faiblesses. Évasion Virtuelle nous renseigne sur tant de questions restées sans réponses, des silences douloureux et des douleurs silencieuses.', 'Nabou Fall, née à Dakar, est une écrivaine, conférencière TEDx-Bamako et Grand-Bassam et activiste sénégalo-ivoirienne pour la promotion des droits de la femme.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685463015.jpg', NULL, '2017', 'Tabala Editions', 'tufeypgl981jwu0l4pzc1rn3u8oaj50sbdye4215hj626gka2z3xalq59xdtf6khwmbyqrmpqnvxcvbismgofo9i7dz748tk7v0w', '2023-05-30 14:10:16', '2023-05-30 14:10:16'),
(77, 'Fédération Ivoirienne du Jeu de Dames', 'Année d\'édition : 2019\r\nFormat d\'impression : 10,5 x 16,5 cm\r\nNombres de pages : 38 pages\r\nISBN : 978-2-37840-031-6', '3000', '2500', 4, 'L’ABC du Jeu de Dames', 'A lire pour maîtriser les règles du jeu de dames, le déplacement des pions, les prises et les combinaisons… Ce livret est recommandé par la Fédération Ivoirienne de Jeu de Dames.', 'Fédération Ivoirienne du Jeu de Dames', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685463233.png', NULL, '2019', 'Tabala Editions', 'guaxrvog4kl53dzvmf9m4r9lpj07385dp8twey2q10o2cxern96qmosyua6ej4bi2hbkscwcqiypk80tn76azsfgtj11h3lzuxdn', '2023-05-30 14:13:54', '2023-05-30 14:13:54'),
(78, 'Faustin Toha', 'Année d\'édition : 2018\r\nFormat d\'impression : 11 x 17,5cm\r\nNombres de pages : 78 pages\r\nISBN : 978-2-37840-019-4', '3000', '2500', 4, 'Comment écrire dans le nouveau français', 'Une contribution pour faire passer les nouveaux aménagements de l’orthographe de la langue française dans l’orthographe ordinaire.', 'Faustin Toha\r\nAncien Directeur de Communication au Port Autonome d\'Abidjan, aujourd\'hui Directeur des éditions à Tabala Editions, écrivain de plusieurs oeuvres.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685463511.png', NULL, '2018', 'Tabala Editions', '7j3cuiplgxtnyq0fv01soslg9xktj5jozdmrnci5wph94ywco9qg4z2itlh1va6m8hz6p0a3q7euurnfe48k226mavxbrsy5eddf', '2023-05-30 14:18:32', '2023-05-30 14:18:32'),
(79, 'Paul Koffi Koffi', 'Année d\'édition : 2017\r\nFormat d\'impression : 13 x 19cm\r\nNombres de pages : 168 pages\r\nISBN : 978-2-37840-007-1', '10000', '5000', 4, 'Management Stratégique, approches et expériences', 'Ce manuel indispensable pour les entrepreneurs allie théorie et pratique. Ainsi il aborde les théories du management depuis Taylor jusqu’aux plus récentes, la problématique du leadership et du manager, et les questions pratiques quotidiennes. Enfin il donne des clés pour la préparation d’un business plan et de plans d’action.', 'Paul Koffi Koffi. \r\nKoffi Paul KOFFI. Ex-Ministre de l\'Enseignement Technique et de la Formation Professionnelle. Né le : 26 janvier 1957.\r\nCommissaire à l\'UEMOA chargé du Développement de l\' Entreprise, des Mines, de l\'Energie et de l\'Economie Numérique.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685464003.png', NULL, '2017', 'Tabala Editions', 'qeazz23g1tw8j0qvb0vbu9udiftjda7ok16zlo3pimca79r9xrd1h2xrcc4sky4nshy65tnvfey5pxfmqo7gphe4j6lnk82g3i8b', '2023-05-30 14:26:44', '2023-05-30 14:26:44'),
(80, 'Baba Kaké', 'Année d\'édition : 2022\r\nFormat d\'impression : 15,5 x 23,5cm\r\nNombres de pages : 188 pages\r\nISBN : 978-2-37840-069-9', '9000', '6000', 4, 'La Boussole du bon Manager socio-éducatif', 'La somme de la riche expérience professionnelle d’un enseignant manager réunie dans un ouvrage inédit et didactique. Le pédagogue tout terrain traite et montre le chemin qui doit faire de l’école un espace de compétences diverses.', 'Guinéen, professeur agrégé d\'Histoire, a enseigné à Paris. Producteur de l\'émission Mémoire d\'un continent à RFI.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11685464169.png', NULL, '2022', 'Tabala Editions', 'xg9b7pwpjj5y6zzd7ghb0u8scm492in613i6zx7wor3apxo412e8sbum5vchqd4ftthqfyllk5k0qvvguke0rt8awmj19e3icsnd', '2023-05-30 14:29:30', '2023-05-30 14:29:30'),
(81, 'Michelle Djédjé', 'Dimension : 14 x 20,8 cm\r\nNombre de pages : 105 \r\nAnnée d\'édition : 2023\r\n\r\nDépôt légal du 31 Juillet 2023\r\nISBN : 978-2-37840-001-9', '7000', '4000', 26, 'De soleil et de fumée (une vie de douleurs)', '« La nuit était douloureuse, interminable. Le sommeil lui manquait comme jamais. Rayna, épuisée par l\'insomnie et une migraine lancinante, faisait tourner dans son esprit les mots de sa mère qui tambourinaient à ses oreilles. (... ) Elle tourna la tête et son regard se posa sur le corps innocent de Salma, qui dormait à poings fermés sur une autre natte, en chien de fusil, sa position favorite. Cette image la plongea dans son passé. A l\'époque, elle avait quinze ans et ses parents l\'avaient mariée de force à Abdou. Elle se souvint avec force détails de toutes les souffrances qu\'il lui avait infligées. Ses yeux s\'embuèrent, puis les larmes perlèrent sur son visage. Parce que, désormais,\r\nlibérée de ce monstre, voilà que Yima, sa mère, voulait imposer le même calvaire à Salma, sa fille unique, le seul trésor qui lui restait sur terre ! Jamais ! Jamais Rayna ne\r\nlaisserait sa mère avoir le dernier mot sur le destin de sa fille. (... ) Lorsque Rayna comprit ce qui lui restait à faire, elle sourit et se rapprocha d\'elle. .. » \r\nEntre satire sociale et désir de liberté, ce texte, qui mêle avec dextérité poésie et écriture fluide, est un chant d\'espérance et de résilience contre la noirceur du monde. Un  véritable combat pour la vie...', 'Michelle Djédjé est une Ivoirienne passionnée de littérature qui vit au Canada. Elle enseigne les études sociales dans la province d\'Alberta.\r\nDe soleil et de fumée est son second roman.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11701686604.png', 'https://www.tabalaeditions.com/media/couverte/couverte1701686606.png', '2023', 'TABALA EDITIONS', '2nvkaojwu1y77xeobjywl0iemj8vp99n5zph684o0edrhu5a35q34x2qusc0t3t9i2pfcmgkzsbglyfvafdd1l6zb7nh41cqxr6t', '2023-12-04 09:43:26', '2023-12-04 09:43:26'),
(82, 'Djeynab Hane-Diallo', 'Dimension : 14 x 20 cm\r\nNombre de pages : 48 \r\nAnnée d\'édition : 2023\r\n\r\nDépôt légal N° 20256 du 25 Septembre 2023\r\nISBN : 978-2-37840-002-6\r\nEAN : 9782378400026', '4000', '4000', 8, 'Qui est la Gentille ? Qui est la Méchante ?', 'Au Soleil Land, un nouvel arrivant changea l’humeur de deux belles filles. On ne parlait que de lui. Surtout les femmes. Mais le beau Bilal n’avait d’yeux que pour Lumière et Sourire.  Ces  deux Fées qui étaient remplies de sagesse sentirent le danger de la haine et du mépris les submerger dans une atmosphère de jalousie.  Le face à face pour gagner le cœur de ce cavalier va-t-il compromettre leur amitié ?', 'Djeynab Hane-Diallo, a publié la Gentille et la Méchante en 2017. Un livre de conte qui figure sur la liste des ouvrages agréés par le Ministère de l’Education Nationale et de l’Alphabétisation.  \r\n\r\nCe deuxième livre de conte, QUI EST LA GENTILLE ? QUI EST LA MECHANTE ? tout comme le premier met en évidence la nécessité de faire triompher le bien sur le mal.', NULL, 'https://www.tabalaeditions.com/media/couverte1/couverte11702296552.png', 'https://www.tabalaeditions.com/media/couverte/couverte1702296553.png', '2023', 'Tabala Editions', 'aofs804v65i3uy4m1c7jpbm0weaqgtj27xyqq65hg0wk6ijb8zgrstbe8u2ddxkhpinadz43fp9ny9fcruotonllzl12s9wxh5re', '2023-12-11 11:09:14', '2023-12-11 11:09:14'),
(85, 'Kadhy Touré', 'Dimension : 14,8 x 21,2 cm\r\nNombre de pages : 150\r\nAnnée d\'édition : 2024\r\n\r\nDépôt légal du 17 Avril 2024\r\nISBN : 978-2-37840-006-4', '15000', '10000', 5, 'Transforme tes rêves  en succès', 'Actrice, réalisatrice, productrice de longs métrages, entrepreneure, présentatrice télé, Kadhy Touré livre ici les clés de son succès : une combinaison de foi, de détermination, d’ambition et d’amour inconditionnel pour les autres.', 'Actrice, réalisatrice, productrice de longs métrages, entrepreneure, présentatrice télé, Kadhy Touré livre ici les clés de son succès : une combinaison de foi, de détermination, d’ambition et d’amour inconditionnel pour les autres.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11715609463.png', 'https://tabalaeditions.com/media/couverte/couverte1715609464.png', '2024', 'TABALA EDITIONS', 'zvmjcn26ou3qxxv2i01r7bciw3cwddkdov49gtxe5qmfur7q18apalhbzhtkinglgs8e5lrfa3169p4p2bw4z05ekjyjm86o79hy', '2024-05-13 12:11:05', '2024-05-13 12:11:05'),
(86, 'S. Baba Kake', 'Dimension : 13 x 19 cm\r\nNombre de pages : 52\r\nAnnée d\'édition : 2024\r\n\r\nDépôt légal du 17 Avril 2024\r\nISBN : 978-2-37840-006-4', '5000', '2500', 4, 'La boussole pour mieux vivre en société', 'Cet ouvrage est un véritable guide pratique dans nos rapports en société. Dans un monde qui donne peu de place à nos valeurs humaines que sont l’amitié, l’amour, le dépassement de soi, etc, l’auteur conçoit des pistes à travers des textes de méditations qui permettent aux lecteurs de retrouver la bonne direction.', 'Monsieur S. BABA KAKE a occupé d’importants postes avant de faire valoir ses droits à la retraite. Il terminé sa carrière en tant que Directeur Régionale de l’Education Nationale de Yamoussoukro.\r\n\r\nPendant plus de quatre décennies, il a formé de nombreux apprenants sur l’ensemble du territoire national\r\n\r\nEnseignant passionné, pédagogue chevronné, et surtout grand manager, il est un partisan du partage du savoir.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11715610053.png', 'https://tabalaeditions.com/media/couverte/couverte1715610054.png', '2024', 'TABALA EDITIONS', 'uaw8p3yz3mahs1xfmlumyc9e8ocnsbeg50eg9d3fpw4kudx8j570r44s2hazbvnjvkztvkijq9iof6r0tlhq12ot6r75gqbywcnx', '2024-05-13 12:20:55', '2024-05-13 12:20:55'),
(87, 'Faustin Toha', 'Dimension : 14,9 x 21,5 cm\r\nNombre de pages : 150\r\nAnnée d\'édition : 2024\r\n\r\nDépôt légal du 17 Avril 2024\r\nISBN : 978-2-37840-012-5', '10000', '5000', 1, 'Bédié, le dernier combat', 'Livre hommage à un homme d’Etat disparu en août 2023. L’auteur a ressorti la seule et unique interview accordée à un journaliste dans laquelle le président Bédié s\'exprime sur les événements qui ont marqué sa vie. Une occasion pour les lecteurs qui veulent bien parcourir la vie du sphinx de Daoukro de ne rien rater. De l’enfance à la vie politique, le président Bédié a connu une trajectoire bien spéciale.', 'Il s’affiche comme un mémorialiste dans cette\r\npublication à caractère testamentaire. L’auteur doit\r\nbeaucoup à la disponibilité du Président Henri Konan\r\nBédié dont les réponses aux questions dans une grande\r\npartie du livre continueront d’enrichir le débat\r\npolitique même après sa disparition.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11715610708.png', 'https://tabalaeditions.com/media/couverte/couverte1715610709.png', '2024', 'TABALA EDITIONS', 'yu8nk06t3x4l5pojwctzql0d5axuzwhmppjdzv1xrqhjdafoiynhl5943ie49s91urkb7igetf0amb72fvvqcey6koms78128s3g', '2024-05-13 12:31:50', '2024-05-13 12:31:50'),
(88, 'Emile Kei Boguinard', 'Dimension : 14 x 21 cm\r\nNombre de pages : 202\r\nAnnée d\'édition : 2024\r\n\r\nISBN : 978-2-37840-037-8', '10000', '5000', 5, 'Mémoire d’un compagnon de l’Aventure 46', 'Emile Kéi Boguinard décrit la vie en terre française des boursiers de l’aventure 46. Par ailleurs, il rend un vibrant hommage à l’initiateur de cette politique avant-gardiste de l’éducation et de l’indépendance de la Côte d’Ivoire, le député Félix Houphouët- Boigny.', 'Emile Kéi Boguinard a été membre de plusieurs gouvernements sous\r\nle Président Houphouët-Boigny : Ministre de la Fonction Publique ,\r\nMinistre d\'Etat ; Premier maire de la ville de Guiglo ; Emérite militant\r\ndu PDCI-RDA. Il naquit le 1er mai 1928.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11715611539.png', 'https://tabalaeditions.com/media/couverte/couverte1715611540.png', '2024', 'TABALA EDITIONS', 'o7vye4e1t9wg36krckmbka2z7txdl08g1h2ypaffsu3cil8br6a367tro0c4pjuhn9qziq50nfpeusnomdsvx58gj1m94w5yxzib', '2024-05-13 12:45:41', '2024-05-13 12:45:41'),
(89, 'Joseph Thierry GNÉKRÉ', 'Dépôt légal : N° 21343 du 29 mai 2024\r\nISBN : 978-2-37840-014-9\r\nEAN : 9782378400149', '15000', '5000', 4, 'Mythes et Réalités de la fonction de Directeur de Cabinet ministériel', 'La réhabilitation du secteur public est un immense chantier vital que chaque pays africain doit élever au rang de priorité nationale. Cependant, celui-ci a plusieurs composantes. L\'un de ces principaux constituants est la formation du personnel de l\'administration publique en général, et spécifiquement celle des Top Managers tels que les Directeurs de cabinets ministériels et Assimilés. \r\nRéflexions puissantes et partage enrichissant d\'expériences sur la fonction de Directeur de cabinet ministériel qui inspireront plus d\'un lecteur, constituent la marque distinctive de cet excellent ouvrage. À lire absolument par tous ceux et toutes celles qui ambitionnent d\'occuper une haute fonction au sein de l\'administration publique ivoirienne.', 'Diplômé en Management des Organisations par l\'Université Laval de QuébeC (Canada) et le Centre Universitaire Professionnalisé d\'Abidjan, l\'auteur est Expert-Formateur dans cette discipline et Chercheur au Laboratoire d\'Etudes et de Prévention en Psycho Education (LEPPE) de l\'École Normale Supérieure (ENS).\r\nIl est titulaire d\'un Master en Droit Public délivré par l\'Université d\'Abidjan ainsi que du Diplôme du Cycle Supérieur de l\'École Nationale d\'Administration (ENA).\r\nJoseph Thierry GNÉKRÉ est Préfet Hors Grade 3ème Échelon. Il a une excellente  connaissance des cabinets ministériels pour avoir occupé successivement les fonctions de Conseiller Technique, de Chef de Cabinet puis de Directeur de Cabinet de plusieurs Ministres. Il a enfin exercé la fonction de Directeur Administratif à la Présidence de la République pendant plus de dix ans.\r\nL\'auteur cumule à ce jour plus de 30 ans d\'expérience professionnelle au sein de l\'appareil administratif ivoirien.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11728469865.png', 'https://tabalaeditions.com/media/couverte/couverte1728469866.png', '2024', 'TABALA EDITIONS', 'kfq8ubgivq6vxdd13y54hwz7r0oy9k9exo2hsqu1e0swa28rz45fzglna3fhav41lbt0tpyeugx2cjisnrmobcw3pjt6dp5n78l9', '2024-10-09 08:31:07', '2024-10-09 08:31:07'),
(90, 'Kouadio Yao Emmanuel', 'Format Poche', '2000', '1000', 7, 'Je lis la Bible en 1 an', 'Apprendre facilement à lire la bible.', 'CEO - Coach, Formateur, Conférencier en Leadership chez Make It Thrive\r\nassionné de lecture et d’écriture, je suis reconnaissant pour la formation reçue de l’Ecole Supérieure de Commerce d\'Abidjan (ESCA), de l’Institut d’Administration des Entreprises (IAE) de l’Université Paris 1 Panthéon Sorbonne, du Centre d’Etudes Financières Economiques et Bancaires (CEFEB), de l’INSEAD et du John Maxwell Team.\r\nJe suis intéressé par le partage des aptitudes acquises en Leadership, Management, Stratégie et Gestion d’Entreprise. \r\nConvaincu que chaque être humain est doté de talents et de capacités pas toujours mis en valeur, j’ambitionne d’accompagner autrui à détecter et à utiliser ses atouts cachés et à accomplir son destin. \r\nLes livres de leadership, en particulier ceux de John Maxwell, et les apports déterminants des membres du John Maxwell Team me permettent de parfaire quotidiennement mes compétences de coach, orateur et entraineur au service de la communauté.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11740481766.png', 'https://tabalaeditions.com/media/couverte/couverte1740481767.png', '2024', 'TABALA EDITIONS', 'yv9fm0pn8qqcda379gnehxyvnu5ol2jvw264zjzcx41lo497ggt6kyptd1isekrqaef25s51smb3jauu8pwxrwm0oc08fibhrzbh', '2025-02-25 10:09:28', '2025-02-25 10:09:28'),
(91, 'Dr François Komoin', '2017 / 10,5 x 18 cm / 100p', '5000', '2500', 7, 'Le Mariage dans l’Eglise Catholique', 'Cet ouvrage, rédigé sous forme de questions réponses, se propose d’expliquer aux époux chrétiens les règles canoniques qui gouvernent leur union.', 'Dr François Komoin', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11740482024.png', 'https://tabalaeditions.com/media/couverte/couverte1740482025.png', '2017', 'TABALA EDITIONS', '7x78ur9yfoecg71tlqfpnxtki3r3nzjbeaied1zhwm09l4pmahkvcj5mn6vsd5ydvz8f4ws69iw5pqgq0kr21o2xb4ba0lco36ht', '2025-02-25 10:13:46', '2025-02-25 10:13:46'),
(92, '𝐉𝐞𝐚𝐧-𝐁𝐚𝐩𝐭𝐢𝐬𝐭𝐞 𝐀𝐊𝐑𝐎𝐔', 'Livre poche', '10000', '5000', 1, '𝑽𝒓𝒂𝒊𝒔 𝒎𝒆𝒏𝒔𝒐𝒏𝒈𝒆𝒔, 𝑭𝒂𝒖𝒔𝒔𝒆𝒔 𝒗𝒆́𝒓𝒊𝒕𝒆́𝒔', 'Le journaliste 𝐉𝐞𝐚𝐧-𝐁𝐚𝐩𝐭𝐢𝐬𝐭𝐞 𝐀𝐊𝐑𝐎𝐔 vous livre un ouvrage percutant : Vrais mensonges, Fausses vérités. À travers une analyse incisive et des témoignages poignants, il éclaire les zones d’ombre de l’histoire récente de la Côte d’Ivoire.', 'Journaliste - Ecrivain\r\nAncien Directeur de Fraternité Matin', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11740482572.jpg', 'https://tabalaeditions.com/media/couverte/couverte1740482573.png', '2024', 'TABALA EDITIONS', 'xdvo061zrhfu7wimu184spsplgkvs9e2egwcj379ytynfztb3e2bn4q5qgo0aylicjlu9nkkb1i65hmoqvcd8zrax4r2mxdfj86h', '2025-02-25 10:22:54', '2025-02-25 10:22:54'),
(93, 'Colonel Dao Moulaye', '2024', '15000', '10000', 26, 'Lumière à l’horizon, LE COMBAT COURAGEUX D’UNE FEMME CONTRE L’ENDOMÉTRIOSE', 'Ce livre met en lumière les voix de celles qui, malgré tout, continuent de se battre pour une vie pleine et épanouie. Préparez-vous à plonger dans un univers où la douleur côtoie\r\nla détermination, où le silence se transforme en cri d\'alarme, et où chaque page révèle un peu plus des secrets de cette maladie encore trop souvent méconnue.', 'Colonel Dao Moulaye', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11740482931.png', 'https://tabalaeditions.com/media/couverte/couverte1740482932.jpg', '2024', 'TABALA EDITIONS', 'v9chid9tapewia7gkpxuol76zx4gg31fpd8jfqnvkvhsy9ft2r6hq3t4nu0ymodqsu5ebzj8rek8no167alicy0js03w15blz22r', '2025-02-25 10:28:52', '2025-02-25 10:28:52'),
(96, 'Jean-Pierre Mukendi', 'Format d\'impression : 11x17,5 cm \r\nNombres de pages : 106 pages\r\nISBN : 978-2-37840-018-7', '3000', '2500', 26, 'Menji, l’orphelin de Kasansa (conte)', 'Un conte qui nous emmène dans l’univers d’un enfant qui passe par des vicissitudes de la vie : de l’enfance à l’âge adulte, de la souffrance à la gloire, de la misère à la prospérité. Une belle histoire d’amour à laquelle participent abeilles, crocodiles et mystérieux nains.', 'JEAN-PIERRE MUKENDI est né à KANANGA en République Démocratique du Congo. Romancier, poète, dramaturge, conteur et nouvelliste, il enseigne les Lettres Modernes au secondaire et les Écrits professionnels dans l\'enseignement supérieur.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11758544979.png', NULL, '2018', 'Tabala Editions', 'n1fv1yx3eniht7ira68tjyl2fgdksodybk4agaskf3qro40tz3oz7x54b5gpj01jcevsv75uwzn68d99x02l9qwupm6ep8u2mrlw', '2025-09-22 10:43:00', '2025-09-22 10:43:00'),
(97, 'Brice Brou', 'Dimension : 16 x 24 cm \r\nNombre de pages : 432 \r\nAnnée d\'édition : 2025 \r\nDépôt légal N° 26128 du 16 Juillet 2025\r\nISBN : 978-2-37840-244-0', '80000', '60000', 5, 'Marie-Thérèse Houphouët-Boigny : Naissance d’une icône (Edition limitée numérotée de 1 à 200)', 'Biographie inédite, Marie-Thérèse Houphouët-Boigny: Naissance d’une icône retrace jeunesse, amour et destin de la première Première dame de Côte d’Ivoire. \r\nProcurez vous le coffret en édition limitée et numérotée de 1 à 200.', 'Brice Brou (né en 1982), conseiller en communication et chercheur indépendant, explore depuis 20 ans l’histoire des indépendances africaines. En 2022, Marie-Thérèse Houphouët-Boigny lui confie sa biographie, aboutissant à un ouvrage inédit de 432 pages mêlant récits et archives rares.', NULL, 'https://tabalaeditions.com/media/couverte1/couverte11758713386.png', 'https://tabalaeditions.com/media/couverte/couverte1758713387.png', '2025', 'Tabala Editions', 'sjo0ltnhynzormt6vtp3dc1kysvgz4lj581ubedvfepzciyh90xgga322ksu8k0w6xcwbor724ju74irbqa6wp9f5mqfxdqi5m7h', '2025-09-24 09:29:48', '2025-09-24 09:29:48');

